{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"3.6.0","file_extension":".r","codemirror_mode":"r"},"kaggle":{"accelerator":"none","dataSources":[],"dockerImageVersionId":30732,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"INTRODUCTION\n\nCyclistic is a bike share company in Chicago. The company provides membership and casual rides services with more than 5800 geo-tracked bicycles across 692 stations throughout Chicago. It have been in operation since 2016 and wants to improve even more the service. \nTo be more inclusive, Cyclistic also offers tricycles, reclining and cargo bikes. About 8% of the rides are with the assistive options, the rest is the traditional. \nCyclistics users are more likely to ride for leisure, but about 30% use the bikes to commute to work each day.\n\nPROBLEMS\n\nSo far, Cyclistic’s finance analysts have concluded that annual members are much more profitable\nthan casual riders and Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments.\n\nBUSINESS TASK\n\nHow do annual members and casual riders use Cyclistic bikes differently?\n\nThe team needs to better understand how annual members and casual riders differ in order to create marketing campaigns to convert casual riders into members.\n\nDATA SOURCES\n\nThe company has a public database of the rides. The data is published monthly and for reason of data privacy, data that contains information that can be used to identify users have been removed. So only informations that can be useful to analyse trends about the rides are available.\n\nCLEANING AND MANIPULATION OF DATA\n\nThe data were checked for any incongruence on data format within the columns and rows, and if the names were typed correctly and if they were matching with the other files.  After, using the statistical program R, the data were compiled in one, and more data cleaning were processed, such as removing ride entries with rides with negative duration and considering the rides with more than 1 minute of duration.\n\nAnother column were added to calculate the average time of each ride to easily help identify trends between the casual and members rides.\n\nIt was analysed the number of rides per weekday and per month, and it also analysed the average duration of the rides. ","metadata":{}},{"cell_type":"code","source":"library(tidyverse)  #helps wrangle data\n# Use the conflicted package to manage conflicts\nlibrary(conflicted)\nlibrary(dplyr)\n# Set dplyr::filter and dplyr::lag as the default choices\nconflict_prefer(\"filter\", \"dplyr\")\nconflict_prefer(\"lag\", \"dplyr\")\n\n\n# All csv files have been previously checked for spaces between the columns names\n\n#=====================\n# STEP 1: COLLECT DATA\n#=====================\n\n# # Upload Divvy datasets (csv files) here\njan <- read_csv(\"202301-divvy-tripdata.csv\")\nfeb <- read_csv(\"202302-divvy-tripdata.csv\")\nmar <- read_csv(\"202303-divvy-tripdata.csv\")\napr <- read_csv(\"202304-divvy-tripdata.csv\")\nmay <- read_csv(\"202305-divvy-tripdata.csv\")\njun <- read_csv(\"202306-divvy-tripdata.csv\")\njul <- read_csv(\"202307-divvy-tripdata.csv\")\naug <- read_csv(\"202308-divvy-tripdata.csv\")\nsep <- read_csv(\"202309-divvy-tripdata.csv\")\noct <- read_csv(\"202310-divvy-tripdata.csv\")\nnov <- read_csv(\"202311-divvy-tripdata.csv\")\ndec <- read_csv(\"202312-divvy-tripdata.csv\")\n\n#====================================================\n# STEP 2: WRANGLE DATA AND COMBINE INTO A SINGLE FILE\n#====================================================\n\nrides <- bind_rows(jan, feb, mar, apr, may, jun, jul, aug, sep, oct, nov, dec)\nrides\n#Sort the data frame by ride_length in ascending order by ride start\n\n\n\nrides <- rides %>%\narrange(started_at)\n\nrides\n\n\n#======================================================\n# STEP 3: CLEAN UP AND ADD DATA TO PREPARE FOR ANALYSIS\n#======================================================\n\n# Inspect the new table that has been created\ncolnames(rides)  # List of column names\nnrow(rides)  # Number of rows\ndim(rides)  # Dimensions of the data frame\nhead(rides)  #See the first 6 rows of the data frame.\ntail(rides) #See the last 6 rows of the data frame\nstr(rides)  #See list of columns and data types (numeric, character, etc)\nsummary(rides)  #Statistical summary of data. Mainly for numerics\n\n# Counting the number of NA's\nna_count <- sum(is.na(rides)) \nna_count\n\n# Counting the number of NA's for every single column (Identifying where the NA's are)\nna_count_per_column <- colSums(is.na(rides))\nna_count_per_column\n\n# Removing the NA's (if NA's are on the columns we will use for analysis)\n#clean_rides <- rides[complete.cases(rides),] # remove rows with NA's\n#clean_rides <- droplevels(clean_rides) # remove unused levels from factors (if any)\n\n#nrow(clean_rides)\n#dim(clean_rides)\n\n#if yes, correct code accordingly after this message\n\n#checking if there is only two names on the member_casual column\nunique(rides$member_casual)\n\n# Adding columns that list the date, month, day, and year of each ride separately\nrides$date <- as.Date(rides$started_at) #The default format is yyyy-mm-dd\nrides$month <- format(as.Date(rides$date), \"%m\")\nrides$day <- format(as.Date(rides$date), \"%d\")\nrides$year <- format(as.Date(rides$date), \"%Y\")\nrides$day_of_week <- format(as.Date(rides$date), \"%A\")\n\n# Add a \"ride_length\" calculation to all_trips and convert to minutes for better information display (it's in seconds by default)\nrides$ride_length <- difftime(rides$ended_at, rides$started_at, units = \"mins\")\n\n# Inspect the structure of the columns\nstr(rides)\n\n# Convert \"ride_length\" to numeric to run calculations on the data\nrides$ride_length <- as.numeric(as.character(rides$ride_length))\nis.numeric(rides$ride_length)\n\n\nsummary(rides)\n\n\n# Removing \"bad\" data \n#removing rides with negatives values and considering only bike rides with more than 1 min\n\nrides_v2 <- rides[!(rides$ride_length<1),]\n\nnrow(rides)\nnrow(rides_v2)\n\nsummary(rides_v2)\n\n#=====================================\n# STEP 4: CONDUCT DESCRIPTIVE ANALYSIS\n#=====================================\n\n# Descriptive analysis on ride_length (all figures in minutes)\nmean(rides_v2$ride_length) #straight average (total ride length / rides)\nmedian(rides_v2$ride_length) #midpoint number in the ascending array of ride lengths\nmax(rides_v2$ride_length) #longest ride\n\n#or in a shorter version\nsummary(rides_v2$ride_length)\n\n# Compare members and casual users\naggregate(rides_v2$ride_length ~ rides_v2$member_casual, FUN = mean)\naggregate(rides_v2$ride_length ~ rides_v2$member_casual, FUN = median)\naggregate(rides_v2$ride_length ~ rides_v2$member_casual, FUN = max)\n\n# Average ride time by each day for members vs casual users\nrides_v2$day_of_week <- ordered(rides_v2$day_of_week, levels=c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\"))\naggregate(rides_v2$ride_length ~ rides_v2$member_casual + rides_v2$day_of_week, FUN = mean)\n\n\n# analyze ridership data by type and weekday\nrides_v2 %>% \n  mutate(weekday = wday(started_at, label = TRUE, week_start = 1)) %>%  # creates weekday field using wday() and specify week_start = 1 to start the week on Monday\n  group_by(member_casual, weekday) %>%  #groups by usertype and weekday\n  summarise(number_of_rides = n()\t\t\t\t\t\t\t#calculates the number of rides and average duration \n            ,average_duration = mean(ride_length)) %>% \t\t# calculates the average duration\n  arrange(member_casual, weekday)\t\t\t\t\t\t\t\t# sorts\n\n\n# Creating a visualization of the number of rides by rider type week\nrides_v2 %>%\n  mutate(weekday = wday(started_at, label = TRUE, week_start = 1)) %>%  # creates weekday field using wday() and specify week_start = 1 to start the week on Monday\n  group_by(member_casual, weekday) %>%\n  summarise(number_of_rides = n(), average_duration = mean(ride_length), .groups = \"drop\") %>%\n  arrange(member_casual, weekday) %>%\n  ggplot(aes(x = weekday, y = number_of_rides, fill = member_casual)) +\n  geom_col(position = \"dodge\") +\n  labs(x = \"Weekday\", y = \"Number of Rides\", fill = \"Member Type\", title = \"Number of Rides by Member Type and Weekday 2023\") +\n  scale_y_continuous(labels = scales::number_format(), limits = c(0, 600000)) # This line changes the number format on the y-axis to display integral numbers instead exponential notation and a limitfor better information display\n\n\n\n# Creating a visualization for average duration week\nrides_v2 %>% \n  mutate(weekday = wday(started_at, label = TRUE, week_start = 1)) %>%  # creates weekday field using wday() and specify week_start = 1 to start the week on Monday\n  group_by(member_casual, weekday) %>% \n  summarise(number_of_rides = n(), average_duration = mean(ride_length), .groups = \"drop\") %>%\n  arrange(member_casual, weekday) %>% \n  ggplot(aes(x = weekday, y = average_duration, fill = member_casual)) +\n  geom_col(position = \"dodge\") +\n  labs(x = \"Weekday\", y = \"Average Duration (minutes)\", fill = \"Member Type\", title = \"Average Ride Duration by Member Type and Weekday 2023\")+\n  scale_y_continuous(limits = c(0, 40))\n\n\n#Creating a visualization of the number of rides by rider type for the year\nmonth_names <- c(\"Jan\", \"Feb\", \"Mar\", \"Apr\", \"May\", \"Jun\", \"Jul\", \"Aug\", \"Sep\", \"Oct\", \"Nov\", \"Dec\")\n\nrides_v2 %>%\n  mutate(month = month(started_at)) %>%  # Extract month from started_at column\n  group_by(member_casual, month) %>%\n  summarise(number_of_rides = n(), average_duration = mean(ride_length), .groups = \"drop\") %>%\n  arrange(member_casual, month) %>%\n  ggplot(aes(x = factor(month, labels = month_names), y = number_of_rides, fill = member_casual)) +  # Convert month to month names\n  geom_col(position = \"dodge\") +\n  labs(x = \"Month\", y = \"Number of Rides\", fill = \"Member Type\", title = \"Number of Rides by Member Type and Month 2023\") +\n  scale_y_continuous(labels = scales::number_format(), limits = c(0, 500000))\n\n# Creating a visualization for average duration year\nrides_v2 %>%\n  mutate(month = month(started_at)) %>%  # Extract month from started_at column\n  group_by(member_casual, month) %>%\n  summarise(number_of_rides = n(), average_duration = mean(ride_length), .groups = \"drop\") %>%\n  arrange(member_casual, month) %>%\n  ggplot(aes(x = factor(month, labels = month_names), y = average_duration, fill = member_casual)) +  # Convert month to month names\n  geom_col(position = \"dodge\") +\n  labs(x = \"Month\", y = \"Average Duration (minutes)\", fill = \"Member Type\", title = \"Average Ride Duration by Member Type and Month 2023\") +\n  scale_y_continuous(limits = c(0, 40))\n\n#creating a pie chart to compare the number of members and casual rides during the year\nmember_counts <- table(rides_v2$member_casual)\npercentages <- round(100 * member_counts / sum(member_counts), 1)\nlabels <- paste(names(member_counts), \": \", percentages, \"%\", sep = \"\")\npie(member_counts, labels = labels, main = \"Distribution of The Rides by Member Type 2023\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"SUMMARY OF ANALYSIS\n \nFor the year of 2021 were registered more than 5.5M rides. Casual rides had more than 2.4M rides and 3M rides for members, the proportion of the rides can be seen on Figure 1 (pie chart). The average ride duration of casual riders were 32 minutes and members were 14 minutes.\n\nThe year of 2022 Cyclistic registered 5.54M rides, a few more rides registered than 2021.  It was registered 2.2M casual rides and 3.2M member rides, the proportion of rides can be seen on the Figure 1. The average ride duration of casual riders were 29.8 minutes and members were 13 minutes.  \n\nFor the year of 2023, there were 5.56M rides, more than the previous years. The number of casual rides for this year was around 2M rides and 3.6M of member rides, the proportion of rides can be seen on the Figure 1. The average duration for casual rides were 29 minutes and for member rides were 13 minutes.","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:49cc0bd1-c2ed-4533-b34c-ce73651bbc35.png)","metadata":{},"attachments":{"49cc0bd1-c2ed-4533-b34c-ce73651bbc35.png":{"image/png":""}}},{"cell_type":"markdown","source":"Along the 3 years it was possible to notice trends that helps to understand the use of casual and member rides and how they differ. It is possible to see on Figure 2 and 3, that the member rides are shorter and maintain the same average throughout the year. The casual rides are longer and increase during the weekend and during the months with the hottest temperatures.","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:fd40f94c-ba94-40db-b65d-ad1ca3ddd124.png)","metadata":{},"attachments":{"fd40f94c-ba94-40db-b65d-ad1ca3ddd124.png":{"image/png":""}}},{"cell_type":"markdown","source":"![image.png](attachment:5e946a22-2f72-487c-b6b8-5b5b45498f5e.png)","metadata":{},"attachments":{"5e946a22-2f72-487c-b6b8-5b5b45498f5e.png":{"image/png":""}}},{"cell_type":"markdown","source":"Related to the number of rides, it is possible to see on Figures 4 and 5, the during the weekdays, members have a larger number of rides and it decreases during weekend, the opposite happens with casual rides. And for this analysis it can also be observed an increase of number of rides during the months with the hottest temperatures.","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:3ced2ab6-8d8e-4aac-ad07-07c4d7c19be5.png)","metadata":{},"attachments":{"3ced2ab6-8d8e-4aac-ad07-07c4d7c19be5.png":{"image/png":""}}},{"cell_type":"markdown","source":"![image.png](attachment:56f4210a-2b50-4281-b97c-63cdff7dd1c8.png)","metadata":{},"attachments":{"56f4210a-2b50-4281-b97c-63cdff7dd1c8.png":{"image/png":""}}},{"cell_type":"markdown","source":"CONCLUSIONS (Key findings)\n\nWith the 3 years of data used, it was possible to notice an increase of number of rides in total and an increase of member rides every year. The increase of rides happens during the hottest months, what can clearly shows that users are trying to spend more time outdoors.\n\nThe average duration shows that members and casual riders differ with member having a shorter ride duration possibly indicating a more planned and direct ride to go to work or home, the casual rides are possibly exploring the city. This can also explain the increase of the number of rides during the weekend by casual members.\n\nSOLUTIONS \n\nIn order to attract more casual riders to acquire the annual membership, marketing campaign targeting only casual riders during the hottest months could attract this riders with the idea they would be saving money on each ride they do if they do the adhesion.\n\nNEXT STEPS (Top three recommendations )\n\n1.Offer a package with some discounted rides in order to attract more casual rides\n\n2.More propaganda on the street and through push notifications on the app reinforcing the idea that the bicycle can be used as a means of transportation for work.\n\n3.Invite a friend and get a discount on the next annual membership renewal.","metadata":{}}]}